import React, { useState } from 'react';

const StudentRegister = () => {
    const [formData, setFormData] = useState({
        name: '',
        dob: '',
        rollNo: '',
        regNo: '',
        branch: '',
        yearOfEntry: '',
        fathersName: '',
        fathersOccupation: '',
        educationBackground: '',
        parentsPhone: '',
        address: '',
        languagesKnown: '',
        guardianName: '',
        schoolName: '',
        mediumOfInstruction: '',
        plus2Marks: '',
        counsellorName: '',
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle registration logic here (e.g., send to API)
    };

    return (
        <form onSubmit={handleSubmit}>
            <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} required />
            <input type="date" name="dob" placeholder="Date of Birth" value={formData.dob} onChange={handleChange} required />
            <input type="text" name="rollNo" placeholder="Roll Number" value={formData.rollNo} onChange={handleChange} required />
            <input type="text" name="regNo" placeholder="Register Number" value={formData.regNo} onChange={handleChange} required />
            <input type="text" name="branch" placeholder="Branch" value={formData.branch} onChange={handleChange} required />
            <input type="text" name="yearOfEntry" placeholder="Year of Entry" value={formData.yearOfEntry} onChange={handleChange} required />
            {/* Add all other fields here */}
            <button type="submit">Register</button>
        </form>
    );
};

export default StudentRegister;
